      <children id="275"/>
      <location class="Point2D.Double" id="276" x="740.0" y="1240.0"/>
      <id id="277" value="ac498415-e6c7-4c07-bd86-3013c8dccdc0"/>
      <revision>1</revision>
      <backgroundColor class="javax.swing.plaf.ColorUIResource" reference="92"/>
      <borderColor class="javax.swing.plaf.ColorUIResource" reference="93"/>
      <textColor class="javax.swing.plaf.ColorUIResource" reference="93"/>
      <text id="278" justification="0" size="4" underlined="false">
        <text>As I see it there are three scopes of unit testing;
1) Scope=ClassName
        A JUnit test that tests a specific class only
2) Scope=PacakgeName
        A JUnit test that tests Interactions between 
       classes in a specific package
3) Functional Testing at the UseCase level
&lt;b/&gt;&lt;/b&gt;
Both Class and Package level testing could 
include specific instruction coverage (similar to EclEmma). 
&lt;/b&gt;
The Functional Info would be created with a String like;
functional:useCase#condition ie;
functional:OrderFood#Food is on the menu.
functional:OrderFood#Food is NOT on the menu.</text>
      </text>
      <color id="279">
        <red>255</red>
        <green>228</green>
        <blue>181</blue>
        <alpha>255</alpha>
      </color>
    </NoteNode>
